import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { WeatherForecastsComponent } from './modules/weather-forecasts/weather-forecasts.component';
import { HttpClientModule } from '@angular/common/http';
import { WeatherForecasts } from './shared/service/weather-forecast.service';

@NgModule({
  declarations: [
    AppComponent,
    WeatherForecastsComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    HttpClientModule
  ],
  providers: [WeatherForecasts],
  bootstrap: [AppComponent]
})
export class AppModule { }
